class Survey extends React.Component {

    state = {
        noCount: 99,
      };

increase = () => {

    this.setState({noCount: this.state.noCount + 1})
}

      render() {
        return (
        //   <div className="text-center"> 
        <div>
            <div>Survey</div>
            <div>Do you like Covid?<span>CDC Official Question</span></div>
          <div>
          <span><button onClick={this.increase}>No</button></span>
              <span>No Total: </span><span>{this.state.noCount}</span>
          </div>
          <div>
          <span><button onClick={this.increase}>Yes</button></span>
              <span>Yes Total: </span><span>0</span>
          </div>
          
          </div>
        );
      }
}

export default Survey;
